import React, { Component } from "react";
import content from "../inputs/content/content.png";
import style from "../inputs/style/style.png";
import result from "../outputs/result.png";

class CustomizedStyle extends Component{
  constructor(props) {
    super(props);
    this.onContentChange = this.onContentChange.bind(this);
    this.onStyleChange = this.onStyleChange.bind(this);
    this.onFormSubmit = this.onFormSubmit.bind(this);
    this.state = {
      content: null,
      style: null,
      alpha: 1,
    };
  };

  onContentChange(e) {
    this.setState({
      content: e.target.files[0],
      style: this.state.style,
    });
  };

  onStyleChange(e) {
    this.setState({
      content: this.state.content,
      style: e.target.files[0],
    });
  };

  onFormSubmit(e) {
    e.preventDefault();
    const formData = new FormData();
    formData.append('content', this.state.content);
    formData.append('style', this.state.style);
    const config = {
      headers: {
        "Content-type": "multipart/form-data",
      },
    };
    const url = "http://localhost:5000/queryaddstyle";
    axios.post(url, formData, config)
      .then((res) => {
        console.log('res', res);
      })
      .catch((err) => {
        console.log('err', err);
      });
  };

  onAlphaChange = ()=>{
    this.setState({
      alpha: document.getElementById('alpha').value,
    })
  };

  render() {
    return (
      <>
        <div className="container my-3">
          <form action="http://localhost:5000/queryCustomizedStyle" method="post" encType="multipart/form-data">
            <div className="mb-3">
              <h1>Upload Images Here</h1>
            </div>
            <div className="mb-3">
                <label htmlFor="content" className="form-label">Content Image</label>
                <input type="file" className="form-control" id="content" />
            </div>
            <div className="mb-3">
                <label htmlFor="style" className="form-label">Style Image</label>
                <input type="file" className="form-control" id="style" />
            </div>
            <div className="mb-3">
              <label className="form-check-label" htmlFor="alpha">Alpha = {this.state.alpha}</label>
              <input type="range" className="form-range" min="0" max="1" step="0.05" id="alpha" onChange={this.onAlphaChange} />
            </div>
            <button type="submit" className="btn btn-primary" >Submit</button>
          </form>
        </div>
        <div className="container my-3">
            <h1>See Results Here</h1>
            <div className="row">
                <div className="col-sm-4">
                    <div className="card" style={{width: '18rem'}}>
                        <img src={content} className="card-img-top" alt="..." />
                        <div className="card-body">
                            <h5 className="card-title">Content Image</h5>
                            <p className="card-text">This is content.</p>
                        </div>
                    </div>
                </div>
                <div className="col-sm-4">
                    <div className="card" style={{width: '18rem'}}>
                        <img src={style} className="card-img-top" alt="..." />
                        <div className="card-body">
                            <h5 className="card-title">Style Image</h5>
                            <p className="card-text">This is style.</p>
                        </div>
                    </div>
                </div>
                <div className="col-sm-4">
                    <div className="card" style={{width: '18rem'}}>
                        <img src={result} className="card-img-top" alt="..." />
                        <div className="card-body">
                            <h5 className="card-title">Result Image</h5>
                            <p className="card-text">This is result.</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
      </>
    );
  };
};

export default CustomizedStyle;
